import React from "react";
import Like from "./common/like";

const Movie = ({ movie, onDelete, onLiked }) => {
  const {
    title,
    genre,
    numberInStock: stock,
    dailyRentalRate: rate,
    _id,
    liked
  } = movie;
  return (
    <tr>
      <th scope="row">{title}</th>
      <td>{genre.name}</td>
      <td>{stock}</td>
      <td>{rate}</td>
      <td>
        <Like liked={liked} onLiked={onLiked} />
      </td>
      <td>
        <button onClick={() => onDelete(_id)} className="btn btn-danger btn-sm">
          Delete
        </button>
      </td>
    </tr>
  );
};

export default Movie;
